import React from 'react';
import Card from '../Card/Card.js';

const CategoryPage = ({ articles,onCardClick }) => {
  return (
    <div>
      {articles.map((item, i) => (
        <Card
          key={i}
          id={i} 
          content={item.content}
          contentSnippet={item.contentSnippet}
          title={item.title}
          link={item.link}
          date={item.pubDate}
          onCardClick={onCardClick} 
        />
      ))}
    </div>
  );
};

export default CategoryPage;
